import React, { useState } from 'react';
import './Payment.css';

import {
    BrowserRouter as Router,
    useHistory,
    useLocation,
    Switch,
    Route,
    Link
} from "react-router-dom";
function Payment(props) {
    const location = useLocation();
    const [client, setClient] = useState(location.state.client);
    const [payment, setPayment] = useState({});
    console.log(props);

    console.log(location);
    return (
        <div >
            <h2>Payment method</h2>
            <h2>{client.Name}</h2>
            <div class="formcontainer">
                <form>
                    <label> Card no:</label>
                    <input type="text" value={payment.CardNo} ></input>
                    <div>
                        <label> Cv code:</label>
                        <input type="text" value={payment.CvCode}></input>
                    </div>
                    <div>Holder name:
                <input type="text" value={payment.HolderName}></input>
                    </div>
                    <div>Validity date:
                <input type="date" value={payment.ValidityDate}></input>
                    </div>
                    <div>
                        <input type="submit"></input>
                    </div>
                </form>
            </div>
        </div>
    );
}
export default Payment;
